const initialState= {
    signin: 0
}
function signInReducer (state=initialState, action) {
    switch (action.type) {
        case 'SIGN_IN': 
        return Object.assign({}, state, {
            signin: {
                    result: action.result}
        })
        default:
            return state
    }
}

export default signInReducer
